import "../styles.css";
import Review from "./Review";
import Rate from "./Rate";
import axios from "axios";
import { useEffect, useState } from "react";

function App() {

  const [data, setData] = useState(null);


  useEffect(() => {
    const fetchData = async () =>{

      try {
        const {data: response} = await axios.get("https://catfact.ninja/fact");
        setData(response);
      } catch (error) {
        console.error(error.message);
      }

    }

    fetchData();
  }, []);


  return (
    <div className="App">
      <p>{data && data.fact}</p>
      <h1 className="merchantName">Merchant Name</h1>
      <Rate rate={4.5} rateCount={1456} />
      <h5>Newest Review:</h5>
      <Review content={"Very Good"} time={"3 days ago"} />
      <Review content={"Bad"} time={"1 month ago"} />
